// @generated: @expo/next-adapter@2.1.52
import React, { useState } from "react";
import { StyleSheet, Text, TouchableOpacity, View } from "react-native";

export default function App() {
    const [withChecks, setWithChecks] = useState([]);
    const [withoutChecks, setWithoutChecks] = useState([]);
    return (
        <View style={styles.container}>
            <Text style={styles.text}>Welcome to Expo + Next.js ðŸ‘‹</Text>
            <TouchableOpacity>
                Start poll (checks every 20 sec)
            </TouchableOpacity>
            <TouchableOpacity>Stop poll</TouchableOpacity>
            <TouchableOpacity onPress={() => setWithChecks([])}>
                Clear log
            </TouchableOpacity>
            <Text>Log</Text>
            {withChecks.map((item) => (
                <View style={{ flexDirection: "row", flex: 1 }}>
                    <View>
                        <Text>{item.time}</Text>
                    </View>
                    <View>
                        <Text>{item.text}</Text>
                    </View>
                </View>
            ))}

            <TouchableOpacity>Start without checks</TouchableOpacity>
            <TouchableOpacity onPress={() => setWithoutChecks([])}>
                Clear log
            </TouchableOpacity>

            {withChecks.map((item) => (
                <View style={{ flexDirection: "row", flex: 1 }}>
                    <View>
                        <Text>{item.time}</Text>
                    </View>
                    <View>
                        <Text>{item.text}</Text>
                    </View>
                </View>
            ))}
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        justifyContent: "center",
        alignItems: "center",
    },
    text: {
        fontSize: 16,
    },
});
